webpackJsonp([0x87829d8687dc],{374:function(t,s){t.exports={data:{markdownRemark:{html:'<p>ИС Услуги предназначена для обеспечения полного жизненного цикла процесса предоставления государственной или муниципальной услуги в электронной форме, начиная от выбора заявителем необходимой ему услуги и подачи соответствующего электронного заявления до получения им подписанного усиленной квалифицированной электронной подписью результата предоставленной услуги или мотивированного отказа, с соблюдением всех требований законодательства, предъявляемых к информационной системе такого класса. ИС Услуги принимает Заявления из любой внешней ИС, МФЦ или интегрированного рабочего кабинета заявителя, и обеспечивает мониторинг и контроль над всеми процессами предоставления услуг в единой точке. ИС Услуги внесена в <a href="https://reestr.minsvyaz.ru/reestr/125814/">Единый реестр российских программ для электронных вычислительных машин и баз данных</a> под регистрационным номером 4251.</p>',frontmatter:{title:"ИС Услуги",statistics:["8 месяцев","3 вида муниципальных услуг","Сотни получателей услуг","4000 оказанных услуг","5000 консультаций"],description:"Информационная система органов исполнительной власти, обеспечивающая автоматизацию административных процедур по предоставлению государственных и муниципальных услуг, зарегистрированная в Едином реестре российских программ для электронных вычислительных машин и баз данных, на примере Портала муниципальных услуг г.Казань",participation:["Идея и концепция проекта","Дизайн и разработка","Эксплуатация и сопровождение"],href:"https://uslugi.headmade.pro/",path:"/is-uslugi/",technologies:["html, css, sass","ruby, ruby-on-rails","react","postgres"],longDesktopImg:"",desktopImg:"",tabletImg:"",phoneImg:""}}},pathContext:{}}}});
